import React from "react";
import css from "./Second.module.css";

const Second = (props) => {
  return (
    <div className={css.second}>
      <div className={css.data}>
        <div className={css.name}>{props.name}</div>
        <img src={props.img} />
      </div>
      {props.message}
      <div>{props.post_img}</div>
    </div>
  );
};

export default Second;
